@bebilt_bryan piloted the car today. We had discussed a plan. @matt_7sixty and @dugan4201 between phone calls and dialing in suspension all day long. We had originally planned to get more weight out of the car but showed up as is. I expected some personal bests but Trevor @tricky_performance reminded me that the shift points wouldn’t be dialed in without more logs especially with change in weather. @hurricaneracingtours Terris knew exactly what we needed and prepped the track again before this pass. I can’t thank the people enough who have put hands on this car you’ll be in the tags There’s so much more to come STAY TUNED. @454chuy let the off season begin brother!!!!! BRING ON 2024 it’s going to be a wild ride. This car has absolutely no PORTING done / Stock trans / Stock Heads / No M5. Let that sink in. 

